import Vue from 'vue';
import Router from 'vue-router';
import HomePage from '@/views/HomePage.vue'; // Ajusta la ruta según tu estructura
import Recetas from '@/views/Recetas.vue'; // Asegúrate de que tengas este componente
import AcercaDe from '@/components/acerca_de.vue'; // Asegúrate de que la ruta sea correcta

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'Home',
      component: HomePage
    },
    {
      path: '/recetas',
      name: 'Recetas',
      component: Recetas
    },
    {
      path: '/acerca_de',
      name: 'AcercaDe',
      component: AcercaDe // Ruta para el componente AcercaDe
    },
    // Otras rutas...
  ]
});
